import "./App.css";
import NavBar from "./components/navBar/NavBar";
import WelcomeContent from "./components/welcomeContent/WelcomeContent";
import RecentBlogs from "./components/recentBlogs/RecentBlogs";

function App() {
  return (
    <div>
      <NavBar />
      <WelcomeContent />
      <RecentBlogs />
    </div>
  );
}

export default App;
